import "./Popup.css"

const Popup = ({addButtonClicked}) => {
    return (
        <article className="popup">
            <div className="popup__wrapper">
                <label htmlFor="name" className="popup__label" id="name">Naam</label>
                <input type="text" className="popup__input">

                </input>
            </div>
            <button onClick={addButtonClicked} className="popup__button">Voeg toe</button>
        </article>
    )
}
export default Popup;
